London Paralympics Closing Ceremony

Arts Documentary hosted by Jon Snow and Krishnan Guru-Murthy and Clare Balding and Ade Adepitan and Jeff Adams, published by Channel 4 in 2012 - English narration


Information
------------------------------

Jon Snow presents the Festival of Flame, the London 2012 Paralympic Closing Ceremony. Coldplay take to the stage to give a live concert in the Olympic Stadium, which will be seen by an estimated worldwide audience of 750 million people. Working with choreographer Kim Gavin, Closing Ceremony Artistic Director, the band performs alongside a cast of almost 2000 in the stadium to celebrate Britain's rich culture of festivals, from the ancient to the modern-day, and mark the closing of the London 2012 Games. A Sunset+Vine/IMG Sport Media Production.

